import ReactDOM from 'react-dom/client';

const Header = ({setSeePosts}) => {

    return (
        <>
            <h1>Stranger's Things</h1>
            <button onClick={() => setSeePosts(true)}>See Posts</button>
        </>

    )
}

export default Header
